// List.jsx
import React, { useState } from 'react';
import styles from '../../css/Boardlist.module.css'; // CSS 모듈 가져오기

const BoardList = () => {
  const [boards, setBoards] = useState([]); 

  useEffect(() => {
      axios.get('http://localhost:8080/spring/board/list') 
          .then(response => setBoards(response.data)) 
  }, []);

  return (
      <div>
          <h2>게시판 리스트</h2>
          <ul>
              {boards.map(board => (
                  <li key={board.seq_board}>
                      <h3>{board.subject}</h3>
                      <p>{board.content}</p>
                  </li>
              ))}
          </ul>
      </div>
  );
};

export default BoardList;
